import React from 'react';
import './App.css';
import CrudApp from './components/crud/CrudApp';
import Header from './components/Header';
import CrudAPI from './components/crud/CrudAPI';

function App() {
  return (
    <div className="App">
      <Header/>
      <CrudAPI/>
      <CrudApp/>
    </div>
  );
}

export default App;
